#define rep(i,n) for(int i=0;i<n;++i)

using ll = long long;
using namespace std;

ll n, m, ans = 0, A[101010];
bool sosu(int n) {
	if (n < 2) return false;
	for (int i = 2; i < n; ++i) {
		if (n%i == 0) return false;
	}
	return true;
}
int main() {
	cin >> n;
	for (int i = 2; i < n + 1; ++i) {
		if (i == 2 || i == 3 || i == 5 || i == 7 || i == 11 || i == 13 || i == 71) ans++;
		else if (i == 17 || i == 19 || i == 23 || i == 29 || i == 31 || i == 37 ) ans++;
		else if (i == 41 || i == 43 || i == 47 || i == 53 || i == 59 || i == 61 || i == 67) ans++;
		else if (i == 73 || i == 79 || i == 83 || i == 89 || i == 97 || i == 101) ans++;

		else if (i % 2 == 0 || i % 3 == 0 || i % 5 == 0 || i % 7 == 0 || i % 11 == 0 || i % 13 == 0) continue;
		else if (i % 17 == 0 || i % 19 == 0 || i % 23 == 0 || i % 29 == 0 || i % 31 == 0 || i % 37 == 0) continue;
		else if (i % 41 == 0 || i % 43 == 0 || i % 47 == 0 || i % 53 == 0 || i % 59 == 0 || i % 61 == 0) continue;
		else if (i % 67 == 0 || i % 71 == 0 || i % 73 == 0 || i % 79 == 0 || i % 83 == 0 || i % 89 == 0) continue;
		else if (i % 97 == 0 || i % 101 == 0) continue;
		else if (sosu(i)) ans++;
	}
	cout << ans << endl;
	return 0;
}
